import React from 'react';
import logo from './logo512.png';
import './App.css';


function App() {
  return (

    <div className="App">
<p>
          COINFLIP
        </p>
      <header className="App-header">

        <img src={logo} className="App-logo" alt="logo" />





      </header>
    </div>
  );
}



export default App;
